{'text': 'Awesome-sauce.

Cosy club with a medium-height ceiling, single bar with an Avatar-like feature pillar, and too many girls, especially on Wednesday nights!

Great music from the Pandemic team - DJ Raw, DJ Cherish, and the hypeman Lefttool! Sometimes there’s guest DJs and rotation of music genre! I recommend checking our Prism’s IG or social media for latest updates/schedule:', 'languageCode': 'en'}

